(914, 194, '_form', '<h3>Информация Обслуживания Асика</h3>\n<label> <h5>Порядковый номер</h5>\n    [text asic-searial]</label>\n<label> <h5>Статус</h5>\n    [text* asic-status] </label>\n<label> <h5>Обслуживание</h5>\n    [textarea asic-maintenance-reason] </label>\n\n\n<h3>Информация об Асике</h3>\n<label> <h5>IP</h5>\n    [text* asic-ip] </label>\n<label> <h5>Локация</h5>\n    [text* asic-location] </label>\n<label> <h5>Poll</h5>\n    [text* asic-poll] </label>\n<label> <h5>Владелец</h5>\n    [text* asic-owner] </label>\n<label> <h5>Дата установки</h5>\n    [date  asic-install-date] </label>\n<label> <h5>Модель</h5>\n    [text asic-model] </label>\n<label> <h5>Asic MODEL</h5>\n    [text* asic_mode] </label>\n<label> <h5>Asic VERSION</h5>\n    [text* Asic_VERSION] </label>\n\n<h3>Информация об батарее</h3>\n<label> <h5>Power Supply MODEL</h5>\n    [text Power_Supply_MODEL] </label>\n<label> <h5>Power Supply ORDER NO</h5>\n    [text power_supply-NO] </label>\n<label> <h5>Power Supply SN</h5>\n    [text power_supply-SN] </label>\n\n<h3>Информация об модуле интернета</h3>\n<label> <h5>Сontrol unit MODEL</h5>\n    [text сontrol_unit-MODEL] </label>\n<label> <h5>Сontrol unit SN</h5>\n    [text сontrol_unit_sn] </label>\n<label> <h5>Сontrol unit W/O</h5>\n    [text сontrol_unit_wo] </label>\n\n[submit \"Добавить асик\"]');
